import React from "react";
import Notes from "./Notes";
import Alert from "./Alert";


const Home = () => {
  return (
    <>
      <div className="container my-3">
        <Alert alert={alert}/>
        <Notes showAlert={showAlert}/>
      </div>
    </>
  );
};

export default Home;
